/*
 User API 예시
 */
import axios from "axios";

const requestLogin = (data, callback, errorCallback) => {
  //백앤드와 로그인 통신하는 부분
  url = "http://" + this.$store.getters.myurl + "/account/login";
  axios
    .post("http://" + this.$store.getters.myurl + "/account/login", data)
    .then(response => {
      callback(response);
    })
    .catch(() => {
      errorCallback();
    });
};

const UserApi = {
  requestLogin: (data, callback, errorCallback) =>
    requestLogin(data, callback, errorCallback)
};

export default UserApi;
